import React from 'react';
import '../css/Navbar.css';

function UserNavbar({ isActive, toggleSidebar }) {

    console.log(isActive);
  return (
    <nav className={`navbar sidebar ${isActive ? 'active' : ''}`}>
      <button onClick={toggleSidebar} className="close-button">✖</button>
      <ul className="navbar-list">
        <li><button>계정</button></li>
        <li><button>이력서</button></li>
        <li><button>포트폴리오</button></li>
      </ul>
    </nav>
  );
}

export default UserNavbar;
